import { Link } from 'react-router-dom';

function Header() {
  return (
    <header style={{ backgroundColor: "#F87316" }} className="shadow">
      <div className="max-w-7xl mx-auto px-4 py-3 flex justify-between items-center">
        <h1 className="text-xl font-bold text-white">ZincScan</h1>
        <nav className="space-x-4 hidden md:block">
          <Link to="/" className="text-sm text-white hover:text-gray-200">Home</Link>
          <Link to="/block" className="text-sm text-white hover:text-gray-200">Blockchain</Link>
          <Link to="/validators" className="text-sm text-white hover:text-gray-200">Validators</Link>
          <Link to="/tokens" className="text-sm text-white hover:text-gray-200">Tokens</Link> {/* updated */}
          <Link to="/more" className="text-sm text-white hover:text-gray-200">More</Link>
        </nav>
      </div>
    </header>
  );
}
